import React from "react";
import "./style.css";
import LinkedIn from '@material-ui/icons/LinkedIn';
import Row from "../Row";
import Col from "../Col";


function Footer() {
  return (
    <footer className="footer">
      <span>R.A. Portfolio 2020</span>
      <Row>
        <Col size="md12">
          <center><LinkedIn 
            style={{
              alignItems: 'center',
              color: 'white',
              fontSize: '60px',
              margin: 0

          }}/></center>
        </Col>
      </Row>
    </footer>
  );
}
export default Footer;
